import React, { useState } from "react";

import { BrowserRouter, Route, Link, Redirect, Switch } from 'react-router-dom';
import Home from './Home.js';
import "./login.css";

class Login extends React.Component {




render () {
  return(
  <div> 

  <BrowserRouter>

  <button>
     <Link to="/Home" >

        Home

      </Link>
      </button>
      <BrowserRouter>
                    <Switch>
                    <Route path="/Home">
                        <Home />
                    </Route>
                    <Route >
                        <Login />
                    </Route>
                    </Switch>
                </BrowserRouter>
  </BrowserRouter>
  </div>
  );
}
}

export default Login;
